import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import { 
  Box, 
  VStack, 
  Heading, 
  Text, 
  Badge,
  HStack,
  Button,
  useColorModeValue,
  SimpleGrid
} from '@chakra-ui/react';
import { Info, ChevronDown, ChevronUp } from 'lucide-react';
import { useFlashcard } from '../contexts/FlashcardContext';

export function MetadataDisplay() {
  const { state } = useFlashcard();
  const [isExpanded, setIsExpanded] = useState(false);
  const bgColor = useColorModeValue('white', 'gray.800');
  const borderColor = useColorModeValue('gray.200', 'gray.700');

  if (!state.metadata) {
    return null;
  }

  const metadata = state.metadata;

  return (
    <AnimatePresence>
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        exit={{ opacity: 0, y: -20 }}
        transition={{ duration: 0.5 }}
      >
        <Box 
          bg={bgColor} 
          rounded="lg" 
          shadow="md" 
          p={4} 
          mt={6}
          borderWidth="1px"
          borderColor={borderColor}
        >
          <Button
            variant="ghost"
            size="sm"
            onClick={() => setIsExpanded(!isExpanded)}
            w="100%"
            justifyContent="space-between"
            p={2}
          >
            <HStack spacing={3}>
              <Info size={16} color="#3182ce" />
              <Text fontSize="sm" fontWeight="medium" color="gray.700">
                Set Information
              </Text>
            </HStack>
            {isExpanded ? <ChevronUp size={16} /> : <ChevronDown size={16} />}
          </Button>

          <AnimatePresence>
            {isExpanded && (
              <motion.div
                initial={{ opacity: 0, height: 0 }}
                animate={{ opacity: 1, height: 'auto' }}
                exit={{ opacity: 0, height: 0 }}
                transition={{ duration: 0.3 }}
                style={{ overflow: 'hidden' }}
              >
                <VStack spacing={4} align="start" pt={4}>
                  <Box w="100%">
                    <SimpleGrid columns={{ base: 1, md: 2 }} spacing={4}>
                      {metadata.source_pdf && (
                        <Box>
                          <Text fontSize="sm" color="gray.600" fontWeight="medium">
                            Source PDF
                          </Text>
                          <Text fontSize="md" color="gray.800">
                            {metadata.source_pdf}
                          </Text>
                        </Box>
                      )}

                      {metadata.total_pages && (
                        <Box>
                          <Text fontSize="sm" color="gray.600" fontWeight="medium">
                            Total Pages
                          </Text>
                          <Text fontSize="md" color="gray.800">
                            {metadata.total_pages}
                          </Text>
                        </Box>
                      )}

                      {metadata.format_type && (
                        <Box>
                          <Text fontSize="sm" color="gray.600" fontWeight="medium">
                            Format Type
                          </Text>
                          <Badge colorScheme="blue" variant="subtle">
                            {metadata.format_type}
                          </Badge>
                        </Box>
                      )}

                      {metadata.questions_extracted && (
                        <Box>
                          <Text fontSize="sm" color="gray.600" fontWeight="medium">
                            Questions Extracted
                          </Text>
                          <Text fontSize="md" color="gray.800">
                            {metadata.questions_extracted}
                          </Text>
                        </Box>
                      )}

                      {metadata.valid_flashcards && (
                        <Box>
                          <Text fontSize="sm" color="gray.600" fontWeight="medium">
                            Valid Flashcards
                          </Text>
                          <Text fontSize="md" color="gray.800">
                            {metadata.valid_flashcards}
                          </Text>
                        </Box>
                      )}

                      {metadata.conversion_timestamp && (
                        <Box>
                          <Text fontSize="sm" color="gray.600" fontWeight="medium">
                            Converted
                          </Text>
                          <Text fontSize="md" color="gray.800">
                            {new Date(metadata.conversion_timestamp).toLocaleDateString()}
                          </Text>
                        </Box>
                      )}
                    </SimpleGrid>
                  </Box>
                </VStack>
              </motion.div>
            )}
          </AnimatePresence>
        </Box>
      </motion.div>
    </AnimatePresence>
  );
}
